import React from 'react';
import MyNavbar from './components/Navbar';
import About from './components/About';
import SkillsSection from './components/SkillsSection';
import Projects from './components/Projects';
import Contact from './components/Contact';
import Footer from './components/Footer';
import Cursor from './components/Cursor'; // Import your Cursor component
import './style/main.css'; // Correctly import your styles
import 'bootstrap/dist/css/bootstrap.min.css';
import ThemeToggle from './components/ThemeToggle';



const App = () => {
  const getTheme = localStorage.getItem("theme");
  console.log("getTheme:", getTheme);
  return (
    <div className={`${getTheme === 'light' ? 'f -sun' : 'fa-moon'}  App`}>
      <Cursor /> {/* Custom cursor component */}
      <MyNavbar /> {/* Navigation bar */}
      <About /> {/* About section */}
      <SkillsSection /> {/* Skills section */}
      <Projects /> {/* Projects section */}
      <Contact /> {/* Contact section */}
      <Footer /> {/* Footer with social links and back to top button */}
      <ThemeToggle />
    </div>
  );
}

export default App;
